    HymnsContent(id: 3321, position: 1, content: "Nji hasa ku tana, ni? \nManinga a Yesu lika; \nNji hasa ku ovoka, ni? \nManinga a Yesu lika.", hymnsNumber: NgHymnsNumberSeeder.MESA_YA_MUANGANA_29, typeStanza: HymnsContentCode.VERSE),
