    HymnsContent(id: 3326, position: 1, content: "Via-ku-lia via muono  \nNji hie Muene, \nNgue omo Ua va lisile laza; \nMu mitima yetu tu ivua ndzala, \nTu ku hianga Yesu, Yove lika.", hymnsNumber: NgHymnsNumberSeeder.MESA_YA_MUANGANA_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3327, position: 2, content: "Tu hianga vimpande  \nViove Muene, \nVi pue ku-lia kua mitima yetu; \nVimpande via vantu ka vi viuka, \nCenu vi linga, ka vi kutisa.", hymnsNumber: NgHymnsNumberSeeder.MESA_YA_MUANGANA_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3328, position: 3, content: "Fukula mukanda  \nUove Muene, \nNji longesemo vusunga Vuove; \nCipue ku vupange, ni ku huima, \nNji ka yongolavio via Kilistu.", hymnsNumber: NgHymnsNumberSeeder.MESA_YA_MUANGANA_30, typeStanza: HymnsContentCode.VERSE),
