    HymnsContent(id: 3330, position: 1, content: "Yesu ua tsile ku kulusu, \nMu ku nji eca ku milonga; \nKuze nja tana mu maninga, \nNji na vuka to.", hymnsNumber: NgHymnsNumberSeeder.MESA_YA_MUANGANA_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3331, content: "Nji na vuka to, nji na vuka t√≥, \nKuze nja tana mu maninga, \nNji na vuka to.", hymnsNumber: NgHymnsNumberSeeder.MESA_YA_MUANGANA_31, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3332, position: 2, content: "Ua nji tambuile na cilemo, \nMuntu ua mupi ua mazilo; \nNja lela lelo mu mutima, \nNji na vuka to.", hymnsNumber: NgHymnsNumberSeeder.MESA_YA_MUANGANA_31, typeStanza: HymnsContentCode.VERSE),
